css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("cardomain.com") {

#siteWrapper>div[class="outerPageWrapper"] {
width: 100% !important;
}

#siteWrapper>div>div[class="innerPageWrapper"],
#pageWrapper,
#right_col,
#related_rides_wrapper,
#related_rides {
margin: 0 !important;
padding: 0 !important;
}

#left_col {
width: 120px !important;
margin: 0 4px 0 0 !important;
}

#left_col+div {
margin: 0 4px 0 0 !important;
}

#related_rides_wrapper {
width: 272px !important;
}

#related_rides {
width: 270px !important;
}

#social_bookmarks_wrapper  {
display: none !important;
}

}
